import Expense from "./component/expense/Expense";

function App(){
    let expenseDate = new Date(2021, 3, 14);
    let expenseTitle = "food expense";
    let expensePrice = 100;

    return(
        <div>
            <Expense
                date ={expenseDate}
                title = {expenseTitle}
            price = {expensePrice}>

            </Expense>
        </div>
    );
}

export default App
